$(document).ready(function(){$(document).on("click",".pagination.ajax li:not(.active) a",function(b){b.preventDefault();var a=$(this).parents(".pagination").data("container");$.ajax({url:$(this).attr("href"),success:function(c){$(a).html(c);$("html, body").animate({scrollTop:$(a).offset().top-$(".navbar-header").height()-$(".navbar-default.sidebar").height()},"slow");clickableEvent()}})})});